import React from "react";
import ImageTwo from "../images/landingpic.jpg";

const Home = () => {
  return (
    <>
      <div className=" h-screen flex justify-center items-center bg-yellow-300">
        <h1 className="text-9xt uppercase font-black">Where to Buy Enfamil</h1>
        <p className="text-7xt font-black">
          At Enfamil, we are dedicated to giving the millions of babies and
          toddlers that rely on our formulas the best start in life. We are
          urgently responding to an increase in demand for many of our brands
          because of a recall by another infant formula manufacturer, and we
          know finding your babies’ formula is important. Did you know that many
          of our formulas are available in both powder and ready-to-use formats?
          If you are unable to find your baby’s favorite product, it may be
          available in a different form or size. Check out our Store Locator
          below, which provides real-time inventory within a 200-mile radius of
          your zip code.
        </p>
      </div>
    </>
  );
};

export default Home;
